import ExpenseItem from "./components/ExpenseItem";

function App() {

  // value of the attributes, accessed in the component!
  const expenses = [
    { title: 'Car insurance', amount: 200, date: new Date(2021, 2, 28) },
    { title: 'padel game', amount: 30, date: new Date(2021, 2, 30) },
    { title: 'expensive dinner', amount: 50.23, date: new Date(2021, 3, 5)}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
        title={expenses[0].title}
        amount={expenses[0].amount} 
        date={expenses[0].date}>  
      </ExpenseItem>
      <ExpenseItem 
        title={expenses[1].title} 
        amount={expenses[1].amount} 
        date={expenses[1].date}>  
      </ExpenseItem>
      <ExpenseItem 
        title={expenses[2].title} 
        amount={expenses[2].amount} 
        date={expenses[2].date}>  
      </ExpenseItem>
    </div>
  );
}

export default App;  // will be imported in index.js
